    //create Mountain model
    public static ArrayList<Pet> getListData() {
        Pet pet;
        ArrayList<Pet> list = new ArrayList<>();

        for (String[] mData : data) {
            pet = new Pet();
            pet.setName(mData[0]);
            pet.setElevation(mData[1]);
            pet.setPhoto(mData[2]);
            pet.setDescription(mData[3]);
            pet.setLocation(mData[4]);

            list.add(pet);
        }

        return list;
    }

